import React from 'react';
import client from '../util/shopify-client'



const MyProduct = () => {

    client.product.fetchAll().then((products) => {
        products.map((item,i) => (
                <div style={{
                    position:"relative",
                    backgroundColor:"red",
                    top:"10vh",
                    width:"10vw",
                    height:"10vh",
                    left:"4vw"
                }}>
                    hello hello welcome
                </div>
        ))
    })

}


const Store = () => {
    return(
        <div>
            Hello
            <MyProduct />
        </div>
    )
}

export default Store;
